INSERT INTO `about` (`id`, `des`) VALUES
(1, 'We believe that generative artificial intelligence (AI) and machine vision has the potential to drastically simplify the visa application process. We are reducing the data entry and document generation steps for both the applicant and our expert reviewers. With the proper use of technology, our goal is to make access to expert immigration advice more accessible since it is easy, low cost, supports multiple languages and is accessible to anyone anywhere with an Internet connection.<br><br>Then everyone would be happier.<br><br>Our partners are an integral part of our successes; they are well trained and experienced in understanding the various decision-making process of the Canadian Immigration Officers, on application case files. They are registered and licensed to practice Canadian immigration and are in good standing with The College of Immigration and Citizenship Consultants (CICC).');
