(61, 'Full Body PEMF Mattress ', '240817121815imageBody.png', '<p><span style=\"font-size:18pt\">No Medicine and Zero side effects and 100 % Safe to use</span></p>\r\n<p>PEMF mattress provides low frequency and low magnitude magnetic waves \r\n\r\nnear to the Earth’s natural field for natural recovery and healing \r\nprocess. It adheres to WHO standard for radiation.<br>\r\n                                We offer both manual and automatic \r\nprograms for electromagnetic field in the range of (30-66 µT) as per \r\nNASA recommendation and frequency from 0-30 Hz. We are offering day and \r\nnight mode with pure copper coils for providing pure pulsating \r\nelectromagnetic field with polarity changing every two minutes and \r\nadjustable running cycles. The electromagnetic field covers most of the \r\nvital organs of the body to give best results.</p><p><iframe width=\"100%\" height=\"auto\" src=\"https://www.youtube.com/embed/EM9bIFk0El8\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe><br></p>', 3, 1),
(62, 'Low Field Transcranial Magnetic Stimulation Helmet for depression', '081217051202rtms.jpg', '<p><span style=\"font-size: 24px;\"><iframe width=\"100%\" height=\"auto\" src=\"https://www.youtube.com/embed/EZLtrMQoQ_0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></span><br></p><p><span style=\"font-size:18pt\">No Medicine and Zero side effects and 100 % Safe to use</span></p>\r\n<p>We are providing Low Field Transcranial Magnetic Stimulation Helmet\r\n with six coils covering all parts of the brain which aids in cell \r\nregeneration and helps in healing of brain related disorders like \r\nDepression, Insomnia and other brain cell degeneration disorders. We \r\nsuggest giving low frequency and low intensity (100-150 µT) at the coil \r\nlevel.</p><p><br></p><p>We have treated more than 40 cases of depression where anti depressant medicine failed to give any relief . Even 15-20 years old cases with excellent results</p><p>To remove the confusion about rTMS I am posting here&nbsp;</p><p><br></p><p>There are two type of rTMS devices one is very high intensity rTMS device that can only be used by the professional doctors in their clinic or hospitals who has special training to run these devices and they are&nbsp; &nbsp;physiatrist doctors and another one is low field trancranial magnetic stimulation devices that can be used in home without any prescription as well as in clinics /hospitals by a doctor.We are using this device which is also registered by the FDA in USA.</p><p>&nbsp;Many research has been done on low field transcranial&nbsp; magnetic stimulation devices which can be read on Google.&nbsp;</p><p>&nbsp;Both the devices have same&nbsp; therapeutic effects.</p><p><br></p><p>Hope this would have cleared your confusion about rTMS and we are&nbsp; not&nbsp; a Phycriatrist Doctor and&nbsp; using&nbsp; low intensity&nbsp; &nbsp;rTMS&nbsp; for depression and other ailments with good results.</p><p><br></p>', 4, 1);
INSERT INTO `category` (`id`, `name`, `photo`, `des`, `fld_order`, `actstat`) VALUES
(64, 'Almag 01 PEMF Device  FDA  registered', '290817050734almag-01__73673.1438706769.500.659.jpg', '<h2 style=\"margin: 0px; padding: 0px 0px 20px; outline: none;\" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\"><span style=\"font-size: 24px;\"><b><iframe width=\"100%\" height=\"auto\" src=\"https://www.youtube.com/embed/1sHUu0pTkaQ\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe></b></span><br></h2><h2 style=\"margin: 0px; padding: 0px 0px 20px; outline: none; font-size: 24px; font-weight: 700; font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\"><img class=\"img-responsive\" src=\"data:image/jpeg;base64,\" data-filename=\"a.jpg\" style=\"width: 1274px;\">The Almag-01 uses Traveling Pulsed Electromagnetic Fields (tPEMF) to help relieve pain and inflammation, among other uses.</h2><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\"><img class=\"__mce_add_custom__\" title=\"Almag\" src=\"http://cdn6.bigcommerce.com/s-ash424/product_images/uploaded_images/almag-ex.jpg?t=1440452453\" alt=\"Almag\" style=\"margin: 0px 0px 15px 30px; padding: 0px; outline: none; max-width: 100%; height: auto; float: right;\" width=\"225\" height=\"200\">The Almag-01 is ISO and CE approved as a tPEMF device, and is FDA listed as a biofeedback device. Due to the nature and distribution of the magnetic field, the Almag-01 can impact a large area at one time. It comes with detailed instructions and doesn\'t require special training.</p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\">Check out these <a href=\"http://www.promolife.com/almag-01-pemf-device/#vids\" style=\"margin: 0px; padding: 0px; outline: none; font-weight: inherit; color: rgb(0, 121, 184);\"><strong style=\"margin: 0px; padding: 0px; outline: none;\">videos</strong></a> for a more visual demonstration.<br style=\"margin: 0px; padding: 0px; outline: none;\"><br style=\"margin: 0px; padding: 0px; outline: none;\">The Almag-01 has been used to counter the effects of sedentary lifestyles, non-manual work and long periods sitting with a computer. Patients have used it to improve visual acuity, and for osteochondrosis, headaches, muscle flaccidity, neurasthenia, hemorrhoids and some prostate conditions, among others.</p><h3 style=\"margin: 0px; padding: 0px 0px 20px; outline: none; font-size: 18px; font-weight: 700; font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\">What is tPEMF?</h3><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\">Traveling Pulsed Electromagnetic Field therapy involves impulses similar to the biological frequencies of your body. As it travels, it can enhance bioactive properties along the organs and body. The dynamics do not allow for adaptation, so the body does not get used to it. This allows the beneficial effects to remain constant. <br style=\"margin: 0px; padding: 0px; outline: none;\"><br style=\"margin: 0px; padding: 0px; outline: none;\">Similar devices have been used for years to treat fractures, injuries and post operative wounds, but many of those devices were large and cumbersome. This device is small, making it perfect for clinics or for home use.<br style=\"margin: 0px; padding: 0px; outline: none;\"><br style=\"margin: 0px; padding: 0px; outline: none;\">Using tPEMF, an analgesic effect is created due to blockage of nerve impulses, reducing spasms and improving local circulation and tissue respiration. This can lead to improved immune responses.<br style=\"margin: 0px; padding: 0px; outline: none;\"><br style=\"margin: 0px; padding: 0px; outline: none;\">PEMF devices were approved by the FDA in 1979 for the stimulation of bone growth. It was approved in the US in 1991 as an adjunct for treatment of post-operative edema and pain. It was again approved by the FDA in 2004 for patients with a high risk for non-fusion, as an adjunct to cervical fusion surgery. It\'s a proven safe therapy for fractures and a variety of other problems.</p><h3 style=\"margin: 0px; padding: 0px 0px 20px; outline: none; font-size: 18px; font-weight: 700; font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\">How does the Almag-01 work?</h3><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\">The Almag-01 can cause an increase in intercellular and intracellular exchange due to the interaction of charged particles. The magnetic field increases interactions between redox process chemical elements, helping to improve tissue and cell metabolism and enhancing the ionization process. Studies show the Almag-01 penetrates deeper than other devices, enough to influence internal organs. Frequencies are within 4-16Hz, the most biologically active. <br style=\"margin: 0px; padding: 0px; outline: none;\"><br style=\"margin: 0px; padding: 0px; outline: none;\">Numerous studies in Europe, Russia, Australia and India show the effectiveness of this device. It is used to help relieve pain and restore mobility, returning the patient to a more active life</p><h3 style=\"font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">TABLE OF CONTENTS:</h3><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">1. Purpose of the Device</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">1.1 General information</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">1.2 Indications for application.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">1.3 Contraindications</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">2. Specifications</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">3. Delivery complete set</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">4. Principle of device operation</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">4.1 Physiological effect of traveling pulsed magnetic field on human organism</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">4.2 Arrangement of the Device</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">4.3 Marking</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">5. Safety measures</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">6. Preparation for use</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">7. Therapeutic procedure</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Locomotors system diseases</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Osteochondrosis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Deforming osteoarthrosis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Arthritis and arthrosis of different joints</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Scapulohumeral periarthritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Arthritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Epicondylitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Gout</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Bursitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Myositis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Paratenonitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Locomotors system injuries</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Bone fractures</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Internal joint injuries</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Wounds, soft tissues bruise, hematoma, post traumatic oedema</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Ligament and muscle injuries</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Post-operation wounds</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Keloid cicatrix</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Sluggish purulent wounds, phlegmons, burns</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Diseases of peripheral nervous system</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Facial nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Radial nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Ulnar nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Median nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Sciatic (sciatica) nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Perennial nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Plexitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Neuralgia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Trigeminal nerve neuralgia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Occipital nerve neuralgia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Intercostal neuralgia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Central nervous system traumas:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Vertebral column and spinal cord traumas</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Disorder of spinal blood circulation</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\">Brain vascular diseases</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Ischemic cerebral stroke</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Diseases of cardiovascular system</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Hypertension of degree I and II</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Renal hypertension</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Hypertonic type of vegeto-vascular dystonia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Ischemic illness of heart with the stable tension stenocardia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– obliterating atherosclerosis (endarteritis) of the vessels of the lower extremities</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Pancreatic diabetes complications</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diabetic angiopathy</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diabetic polyneuropathy</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Dermatologic diseases</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Itching dermatosis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Dermal plastic operation postoperative condition</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Chronic nonspecific lung diseases</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic bronchitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic pneumonia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Bronchial asthma</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Gastrointestinal tract disorders</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Subacute and chronic pancreatitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Biliary dyskinesia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic gastritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Stomach and duodenum ulcer</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">Female genital organs diseases</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Uterus and uterine appendages inflammatory diseases in the subacute period</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diseases caused by ovary hypo function</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Cesarean post operation condition</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Diseases of venous system of the upper and lower extremities</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Deep vein thrombosis of a lower leg</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Chronic thrombophlebitis in a stage of trophic disorders varicose illness</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">***</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">ALMAG-01 is made to be used for treatment and prophylactic of a wide spectrum of diseases using the tPEMF (Traveling Pulsed Magnetic Field Therapy). While using this devise, as recommended by your physician or therapist, follow the suggested therapeutic regime.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">This operating manual is a document guaranteeing the basic parameters of ALMAG-01, and certifying its technical characteristics. Also, this manual is a guide to show the purchaser all the methods and techniques of using this devise.</p><h3 style=\"font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">1. PURPOSE OF THE DEVICE</h3><h4 style=\"font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">1.2 INDICATIONS FOR USE</h4><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Locomotors system diseases:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Spinal osteochondrosis with reflex cervical spine, thorax and loin radicular syndrome</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Deforming osteoarthrosis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Arthritis and arthrosis of different joints: scapulohumeral periarthritis, arthritis, epicondylitis, gout</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Bursitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Myositis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Paratenonitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Locomotors system juries and their after-affect:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Bone fractures;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Internal joint damages;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Posttraumatic joint contracture;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Wound- soft tissue bruise, hematoma, and posttraumatic edema;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Muscle and ligaments injuries;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">-postoperative wounds;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Keloid cicatrix;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Sluggish purulent wounds, phlegmons, burns.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Neurologic diseases:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diseases of peripheral nervous system;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Neuritis’s:</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Facial nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Radial nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Neuritis of the ulnar nerve</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Median nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Sciatic nerve (ischias) neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Peroneal nerve neuritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Plexitis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Neuralgias:</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Trigeminal nerve neuralgia,</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Occipital nerve neuralgia,</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Intercostal neuralgia</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Traumas of central nervous system:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Trauma of a backbone and a spinal cord;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Disorder of a spinal blood circulation,</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Circulation with chronic ischemic illness of heart</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Brain vascular diseases:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Ischemic cerebral stroke.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Diseases of cardiovascular system:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Idiopathic hypertension of I – II degree;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Renal hypertonic;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Vegetovascular dystonia about the hypertonic type;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Ischemic illness of heart with a stable stenocardia (under the medial supervision);</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– obliterating atherosclerosis of vessels of the lower extremities (obliteration endarteritis).</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Complications of diabetes:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diabetic angiopathy;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diabetic polyneuropathy.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Dermatologic diseases:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">-itching dermatosis;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">-Dermal plastic operation postoperative condition.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">Chronic nonspecific lung diseases:</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic bronchitis;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic pneumonia;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Bronchial asthma.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Gastrointestinal tract disorders:</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Subacute and chronic pancreatic;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Biliary dyskinesia;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic gastritis</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Stomach and duodenum ulcer;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">Female genital organs diseases</span></p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Uterus and uterine appendages inflammatory diseases in the subacute period</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Diseases caused by ovary hypo function</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Cesarean post operation condition</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">Venous disorders of upper and lower extremities:</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Thrombosis of deep chin veins;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Chronic thrombophlebitis at the trophic disturbance stage;</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;=\"\" padding-left:=\"\" 30px;\"=\"\">– Varicose disease</p><h4 style=\"font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">1.3. CONTRAINDICATIONS</h4><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\">– Inflammably diseases in the acute phase; Hemorrhage and predisposition to it; High-grade hypotension; Purulent processes before surgical treatment; Severe cardiac ischemia; Early post infarction period; Acute phase of cerebral blood circulation disturbance (stroke); Pregnancy; Systemic blood diseases; Oncological diseases; Thyrotoxicosis; Diencephalic syndrome; The presence of implanted cardio stimulator in the zone of action.</p><p class=\"main__articles-page-item-text\" style=\"font-size: 18px; color: rgb(61, 61, 61); font-family: \" fira=\"\" sans\",=\"\" sans-serif;=\"\" background-color:=\"\" rgb(250,=\"\" 250,=\"\" 250);=\"\" text-align:=\"\" justify;\"=\"\"><span style=\"font-weight: 700;\">The presence of small metal inclusions in the osseous tissue does not serve the contraindication to the use of device in the therapeutic doses.</span></p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\"><br></p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(239,=\"\" 239,=\"\" 239);\"=\"\"> </p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; background-color: #FFF;\"><a class=\"btn btn-warning\" href=\"https://almagia.com/wp-content/uploads/2017/12/Operating-manual-for-Almag-01-new-version.pdf\" target=\"_blank\">INSTRUCTION MANUAL</a></p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; background-color: rgb(239, 239, 239);\"><br></p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; background-color: rgb(239, 239, 239);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"almag 01.jpg\" class=\"img-responsive\"><br></p><p style=\"margin-bottom: 20px; padding: 0px; outline: none; line-height: 1.5; background-color: rgb(239, 239, 239);\"><br></p>', 2, 1);
INSERT INTO `category` (`id`, `name`, `photo`, `des`, `fld_order`, `actstat`) VALUES
(65, 'Almag 02 PEMF Device FDA registered', '190418075138almag 01.jpg', '<p><iframe width=\"100%\" height=\"auto\" src=\"https://www.youtube.com/embed/peV752SyWX4\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></p><p></p><p></p><p><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"download.jpg\" style=\"width: 100%;\"></p><p></p><p></p><p></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"00000000000000000000.jpg\" style=\"width: 100%;\"><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"11111111111111111.jpg\" style=\"width: 100%;\"><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"xxxxxxxxxxxxxx - Copy.jpg\" style=\"width: 100%;\"></p><p></p><p><br></p><h3 gill=\"\" sans\",=\"\" \"gill=\"\" sans=\"\" mt\",=\"\" \"myriad=\"\" pro\",=\"\" \"dejavu=\"\" condensed\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; color: rgb(0, 0, 0);\"></h3><h3 gill=\"\" sans\",=\"\" \"gill=\"\" sans=\"\" mt\",=\"\" \"myriad=\"\" pro\",=\"\" \"dejavu=\"\" condensed\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;\"=\"\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; color: rgb(0, 0, 0);\">APPLICATIONS OF MAGNETIC THERAPEUTIC APPARATUS ALMAG-02</h3><p gill=\"\" sans\",=\"\" \"gill=\"\" sans=\"\" mt\",=\"\" \"myriad=\"\" pro\",=\"\" \"dejavu=\"\" condensed\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" medium;\"=\"\" style=\"margin-bottom: 0px; padding: 0px 0px 15px; color: rgb(51, 51, 51);\">1. Neurocirculatory dystonia after hypertonic type.<br style=\"margin: 0px; padding: 0px;\">2. Migraine.<br style=\"margin: 0px; padding: 0px;\">3. Temporary transient ischemic attack.<br style=\"margin: 0px; padding: 0px;\">4. Damage to individual nerve root and plexus of the upper and lower extremities.<br style=\"margin: 0px; padding: 0px;\">5. Alcoholic polyneuropathy.<br style=\"margin: 0px; padding: 0px;\">6. Diabetic Polyneuropathy.<br style=\"margin: 0px; padding: 0px;\">7. Post-herpetic neuropathy.<br style=\"margin: 0px; padding: 0px;\">8. Raynaud\'s syndrome (syndrome of dead fingers)<br style=\"margin: 0px; padding: 0px;\">9. Chronic sinusitis maxillary area (maxillary sinusitis), chronic sinusitis in the forehead (sinusitis)<br style=\"margin: 0px; padding: 0px;\">10. Chronic and acute eustachitis (Salpingootitis).<br style=\"margin: 0px; padding: 0px;\">11. Acute laryngitis.<br style=\"margin: 0px; padding: 0px;\">12. Chronic laryngitis.<br style=\"margin: 0px; padding: 0px;\">13. Neuro sensory hearing.<br style=\"margin: 0px; padding: 0px;\">14. Hypertension.<br style=\"margin: 0px; padding: 0px;\">15. Stable angina.<br style=\"margin: 0px; padding: 0px;\">16. Stroke.<br style=\"margin: 0px; padding: 0px;\">17. Folgeyustand after cerebrovascular disease /<br style=\"margin: 0px; padding: 0px;\">18. Atherosclerosis of vessels, deforming or obliterative endarteritis.<br style=\"margin: 0px; padding: 0px;\">19. Atherosclerotic (discirculatory) encephalopathy<br style=\"margin: 0px; padding: 0px;\">20. Varicose veins.<br style=\"margin: 0px; padding: 0px;\">21. Deep vein thrombosis of the tibia.<br style=\"margin: 0px; padding: 0px;\">22. Chronic venous thrombosis with trophic disorders.<br style=\"margin: 0px; padding: 0px;\">23 Chronic lymphedema.<br style=\"margin: 0px; padding: 0px;\">24 Viral pneumonia.<br style=\"margin: 0px; padding: 0px;\">25. Bacterial pneumonia.<br style=\"margin: 0px; padding: 0px;\">26. Chronic bronchitis except for the acute stage.<br style=\"margin: 0px; padding: 0px;\">27 Lung spasm.<br style=\"margin: 0px; padding: 0px;\">28. Exudative pleurisy (by liquid extraction from pleural cavity).<br style=\"margin: 0px; padding: 0px;\">29 Reflux oesophagitis.<br style=\"margin: 0px; padding: 0px;\">30 Gastric and duodenal ulcer.<br style=\"margin: 0px; padding: 0px;\">31 Gastritis and duodenitis.<br style=\"margin: 0px; padding: 0px;\">32. Chronic hepatitis.<br style=\"margin: 0px; padding: 0px;\">33. Toxic liver damage.<br style=\"margin: 0px; padding: 0px;\">34. Irritable bowel syndrome without diarrhea.<br style=\"margin: 0px; padding: 0px;\">35. Alcoholic liver disease.<br style=\"margin: 0px; padding: 0px;\">36. Cholecystitis.<br style=\"margin: 0px; padding: 0px;\">37. Biliary dyskinesia.<br style=\"margin: 0px; padding: 0px;\">38. Hyperkinetic dyskinesia of the gallbladder (Cholezystopathie without gallstones).<br style=\"margin: 0px; padding: 0px;\">39. Chronic pancreatitis.<br style=\"margin: 0px; padding: 0px;\">40. Postoperative bowel syndrome.<br style=\"margin: 0px; padding: 0px;\">41. Postcholecystectomy syndrome.<br style=\"margin: 0px; padding: 0px;\">42. Keloid scars.<br style=\"margin: 0px; padding: 0px;\">43. Lichunacuminatus.<br style=\"margin: 0px; padding: 0px;\">44. Localized Eczema, skin itching, hives, eczema, atopic dermatitis.<br style=\"margin: 0px; padding: 0px;\">45. Psoriasis.<br style=\"margin: 0px; padding: 0px;\">46. Hydradenitis.<br style=\"margin: 0px; padding: 0px;\">47. Gout.<br style=\"margin: 0px; padding: 0px;\">48. Polyarthrosis.<br style=\"margin: 0px; padding: 0px;\">49. Coxarthrosis.<br style=\"margin: 0px; padding: 0px;\">50. Osteoarthritis.<br style=\"margin: 0px; padding: 0px;\">51. Osteoarthritis of the metacarpophalangeal joint.<br style=\"margin: 0px; padding: 0px;\">52. Outside epicondyle of the humerus (tennis elbow) and internal epicondyle of the humerus (golfer\'s elbow).<br style=\"margin: 0px; padding: 0px;\">53. Painful shoulder stiffness.<br style=\"margin: 0px; padding: 0px;\">54. Acute trophoneurotische bone atrophy.<br style=\"margin: 0px; padding: 0px;\">55. Paratenonitis (krepitierende tenosynovitis of the forearm).<br style=\"margin: 0px; padding: 0px;\">56. Tietze Syndrome (aseptic inflammation of rib cartilage in the area of the sternum approach of the ribs).<br style=\"margin: 0px; padding: 0px;\">57. Osteochondropathy (Keller syndrome, lunatomalacia, Perthes disease, Osgood-Schlatter disease, King \'disease osteochondritisdissecans). 58. Ankylosing spondylitis (ankylosing spondylitis).<br style=\"margin: 0px; padding: 0px;\">59. Osteoarthritis arthritis of the temporomandibular joint.<br style=\"margin: 0px; padding: 0px;\">60. Fersenperiostose (Plantarfascitis), heel spurs.<br style=\"margin: 0px; padding: 0px;\">61. Joint contracture.<br style=\"margin: 0px; padding: 0px;\">62. Rheumatoid arthritis.<br style=\"margin: 0px; padding: 0px;\">63. Osteochondrosis.<br style=\"margin: 0px; padding: 0px;\">64. Vertebrobasiläres syndrome.<br style=\"margin: 0px; padding: 0px;\">65. Sympathetic rear cervical syndrome.<br style=\"margin: 0px; padding: 0px;\">66. Syndrome of vertebrogenic myelopathy.<br style=\"margin: 0px; padding: 0px;\">67. Osteoporosis without pathological fracture.<br style=\"margin: 0px; padding: 0px;\">68. Osteoporosis with pathological fracture.<br style=\"margin: 0px; padding: 0px;\">69. Chronic tubulointerstitial nephritis (produced by drugs and heavy metals tubular damage).<br style=\"margin: 0px; padding: 0px;\">70. Kidney and ureteral stones.<br style=\"margin: 0px; padding: 0px;\">71. Cystitis.<br style=\"margin: 0px; padding: 0px;\">72. Pelvic Inflammatory Disease and oophoritis.<br style=\"margin: 0px; padding: 0px;\">73. Postoperative wounds.<br style=\"margin: 0px; padding: 0px;\">74. Post-traumatic hematoma.<br style=\"margin: 0px; padding: 0px;\">75. Dislocation, strain and overwork of capsular ligaments of the elbow joint.<br style=\"margin: 0px; padding: 0px;\">76. radial head.<br style=\"margin: 0px; padding: 0px;\">77. Traumatic rupture of lateral spokes tape.<br style=\"margin: 0px; padding: 0px;\">78. Trauma of Elle Nerves in the area of the forearm.<br style=\"margin: 0px; padding: 0px;\">79. Finger bruise without injury to the nail plate.<br style=\"margin: 0px; padding: 0px;\">80. Finger contusion injury with the nail plate.<br style=\"margin: 0px; padding: 0px;\">81. Outer traumas of several areas of the upper extremities.<br style=\"margin: 0px; padding: 0px;\">82. Outer traumas of several areas of the lower extremities.<br style=\"margin: 0px; padding: 0px;\">83. Hip joint injury.<br style=\"margin: 0px; padding: 0px;\">84. Leg contusion.<br style=\"margin: 0px; padding: 0px;\">85. Traumatic coccygodynia.<br style=\"margin: 0px; padding: 0px;\">86. Shin contusion.<br style=\"margin: 0px; padding: 0px;\">87. Multiple external trauma of the tibia.<br style=\"margin: 0px; padding: 0px;\">88. knee sprain.<br style=\"margin: 0px; padding: 0px;\">89. Sprunggelenkkontusion.<br style=\"margin: 0px; padding: 0px;\">90. Bruised toe without damaging the nail plate.<br style=\"margin: 0px; padding: 0px;\">91. Bruised toe with violation of the nail plate.<br style=\"margin: 0px; padding: 0px;\">92. Several external injuries of the ankle and foot.<br style=\"margin: 0px; padding: 0px;\">93. ankle sprain.<br style=\"margin: 0px; padding: 0px;\">94. Bänderruptur the ankle and foot.<br style=\"margin: 0px; padding: 0px;\">95. strain and overexertion of ligaments of the ankle.<br style=\"margin: 0px; padding: 0px;\">96. Trauma of external Plantarnervs.<br style=\"margin: 0px; padding: 0px;\">97. Trauma of the inner Plantarnervs.<br style=\"margin: 0px; padding: 0px;\">98. Trauma of multiple nerves at ankle and foot.<br style=\"margin: 0px; padding: 0px;\">99. Trauma of the big toe at ankle and foot lifter.<br style=\"margin: 0px; padding: 0px;\">100. Trauma of multiple muscles and tendons at ankle.</p><div><img src=\"data:image/jpeg;base64,\" data-filename=\"manual.jpg\" style=\"width: 50%;\"><br></div><p gill=\"\" sans\",=\"\" \"gill=\"\" sans=\"\" mt\",=\"\" \"myriad=\"\" pro\",=\"\" \"dejavu=\"\" condensed\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" medium;\"=\"\" style=\"margin-bottom: 0px; padding: 0px 0px 15px;\"><font color=\"#333333\"></font><br></p><p gill=\"\" sans\",=\"\" \"gill=\"\" sans=\"\" mt\",=\"\" \"myriad=\"\" pro\",=\"\" \"dejavu=\"\" condensed\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" medium;\"=\"\" style=\"margin-bottom: 0px; padding: 0px 0px 15px; color: rgb(51, 51, 51);\"><br></p><p gill=\"\" sans\",=\"\" \"gill=\"\" sans=\"\" mt\",=\"\" \"myriad=\"\" pro\",=\"\" \"dejavu=\"\" condensed\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" medium;\"=\"\" style=\"margin-bottom: 0px; padding: 0px 0px 15px; color: rgb(51, 51, 51);\"></p>', 1, 1);
