und-clip: initial;\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">e-mail: muzgp10@rambler.ru</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span class=\"col-md-12\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" align=\"center\"><span style=\"font-size:12.0pt;font-family:\">Dated 10/04/2014\r\nNo. 01-10-105711</span><b><i><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";mso-bidi-theme-font:minor-bidi;=\"\" mso-font-kerning:18.0pt\"=\"\"><o:p> <br></o:p></span></i></b></p><p></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" align=\"center\"><b><i><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";mso-bidi-theme-font:minor-bidi;=\"\" mso-font-kerning:18.0pt\"=\"\">Application of Magnetic Field in Complex Treatment of </span></i></b><b><i><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-font-kerning:18.0pt\"=\"\"><o:p></o:p></span></i></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" align=\"center\"><b><i><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";mso-bidi-theme-font:minor-bidi;=\"\" mso-font-kerning:18.0pt\"=\"\">Rheumatoid Arthritis Patients.</span></i></b><b><i><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-font-kerning:18.0pt\"=\"\"><o:p></o:p></span></i></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Rheumatoid\r\narthritis (RA) is a disease which has for decades been the focus of\r\nrheumatologists\' attention all over the world. This is explained by major\r\nmedical and social significance of the disease. Its prevalence reaches 0.5-2%\r\nof total population in developed countries. Rheumatoid arthritis patients are\r\nprone to a 3 to 7 years\' shorter life expectancy as compared to the overall\r\npopulation. The damage caused by this disease to the society is enormous due to\r\nearly disability of patients, which can occur in the first 5 years from the\r\ndisease onset, in case if its active treatment has not been started in good\r\ntime.</p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Rheumatoid\r\narthritis is a chronic inflammatory disease of unclear origin, which is\r\ncharacterized by damage of peripheral synovial joints and periarticular\r\ntissues, accompanied by autoimmune disorders and possibly leading to\r\ndestruction of articular cartilage and bone, as well as to systemic\r\ninflammatory changes.</p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><b><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p> </o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">The purpose of the study</span></b><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";mso-bidi-theme-font:minor-bidi\"=\"\"> is\r\nto evaluate the possibility of enhancing the effectiveness of complex therapy\r\nof rheumatoid arthritis by including exposure to pulsed magnetic field produced\r\nby \"Almag-02\" device as part of the therapeutic process.</span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p> </o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Materials and Methods<br></span></b><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Work had been conducted over a\r\n2-year period between 2010 and 2012. In this period, 62 patients suffering from\r\nRA were under medical supervision. The diagnosis was verified in accordance\r\nwith the American Rheumatism Association criteria. The clinical profile of the\r\npatients is presented in Table 1.</span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Among the surveyed\r\nindividuals, female patients prevailed, who had RA of second degree of\r\nactivity, radiographic stage II-III, accompanied by joints insufficiency (JI)\r\nof degrees I-II.</span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">All participants of the study\r\nwere divided into 2 groups: treatment one (36 patients) and control one (26\r\npatients). Magneto-therapy within the treatment group was conducted in line\r\nwith background therapy. During the study, the dosage of disease-modifying\r\ndrugs was not changed, and no intra-articular administration of glucocorticoids\r\nwas performed. The last intra-articular administration of glucocorticoids was\r\nallowed not less than one month prior to initial engagement in the study.</span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Magneto-therapy procedures\r\nwith \"Almag-02\" device were provided once a day within 12-day period\r\nas follows: The main emitter was placed over the adrenal glands projection\r\narea, and the affected joint was wrapped with the flexible emitting line. Both\r\nemitters were positioned with their north polarity sides adjacent to the body.\r\nField density: 10 mT (main emitter) and 6 mT (flexible emitting line);\r\nfrequency: 100 Hz and 16 Hz respectively. Procedure duration: 10 minutes.\r\nExposure of two joints within a single procedure was allowed; in that case, the\r\nexposure time was 10 minutes for each joint. The patients of the control group\r\nwere receiving only background therapy. </span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><i><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p> </o:p></span></i></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Table 1. Clinical profile of RA patients</span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p></o:p></span></p><table class=\"MsoNormalTable\" style=\"width: 100%; margin-left: 4.65pt;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:15.6pt\">\r\n  <td rowspan=\"2\" style=\"width:176.0pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt;height:15.6pt\" width=\"235\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Parameters</span><span style=\"font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p></o:p></span></p>\r\n  </td>\r\n  <td colspan=\"2\" style=\"width:243.0pt;border:solid windowtext 1.0pt;\r\n  border-left:none;mso-border-top-alt:solid windowtext .5pt;mso-border-bottom-alt:\r\n  solid windowtext .5pt;mso-border-right-alt:solid windowtext .5pt;padding:\r\n  0in 5.4pt 0in 5.4pt;height:15.6pt\" width=\"324\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-ali