(67, 'Physiotherapy....We Treat Injuries Others Can not Fix. Successfully Treating Difficult Injuries', '200917081624123456789add006.jpg', '<p><span style=\"font-size:18pt\">No Medicine and Zero side effects and 100 % Safe to use</span></p>\r\n<p> we treat knee pain back pain arthritis cervical pain ankylosing spondyitis slip disc herniated disc sciatica fibromalgia vericose veins  etc</p><h3 class=\"r\" style=\"font-size: 18px; margin: 0px; padding: 0px; overflow: hidden; text-overflow: ellipsis; white-space: nowrap; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><br></h3>', 7, 1),
(68, 'knee pain relief without surgery', '280718124813IMG_20180726_220000.JPG', '<p><span style=\"font-size:18pt\">No Medicine and Zero side effects and 100 % Safe to use</span> </p><ol><li>Improve knee pain without surgery with the help of pulsed electromagnetic field therapy  </li><li>no need of knee replacement surgery in 90% cases</li><li>no pain, no medicine ,no surgery</li></ol><h2 style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:\r\n0in;line-height:21.0pt;background:#363839\"><span style=\"font-size:20.5pt;\r\nfont-family:\" trebuchet=\"\" ms\",\"sans-serif\";color:white\"=\"\">India’s Most Advanced\r\nNon-Surgical Pain Treatment Services<o:p></o:p></span></h2><p><br></p>', 6, 1),
(69, 'vericose veins, diabetic wound', '290817064640add 0005.jpg', '<p>We treat diabetic wounds diabetic - neuropathy, ulcer, retinopathy   </p>\r\n<p>\r\n    <br>\r\n</p>\r\n<p>No medicine no surgery and zero side effects and 100% safe to use </p>\r\n<p>\r\n    <br>\r\n</p>\r\n<p>study paper</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">                 </span><span style=\"font-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">Approved by\r\nchief physician<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:\" Arial \",\"sans-serif \";mso-ansi-language:\r\nEN-US\">                         of City\r\nClinical Hospital of the Healthcare Department<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-family:\" Arial \",\"sans-serif \";mso-ansi-language:\r\nEN-US\">                         \"Krasnoyarsk Interregional Clinical\r\nHospital No. 20 named after I. S. Berzona\" <o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:404.0pt\"><span style=\"font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\">                                                                                                                                                                            Fokhin V.A.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:85.05pt;text-indent:-85.05pt\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\"> <o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:85.05pt;text-indent:-85.05pt\"><b><span style=\"font-size:14.0pt;line-height:\r\n115%;font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\">Magnetotherapy Effectiveness\r\nEvaluation of the Device \"ALMAG-02\"                for Treatment of Varicose Disease<o:p></o:p></span></b>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;\r\nline-height:115%;font-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">     Varicose veins disease of the lower\r\nextremities is the most common cause for formation of chronic venous insufficiency\r\nof the lower extremities that determines the relevance of research conducted in\r\nthis field of modern medicine. Venous disease in Europe among people aged 30 to\r\n70 years occurs in 25-30% of the population, and the average age of most\r\npatients is 45 years. In Russia, varicose veins and thrombophlebitis\r\nconsequences affect more than 35 million people. While 15% of them have\r\ndecompensated form of the disease with marked trophic disorders, and only every\r\n4th patient gets an adequate treatment (Saveliev V. S. and co-author).\r\nDevelopment and implementation of effective, safe and available method of\r\nvaricose veins disease treatment is more than relevant. In this regard, the\r\npresent study was carried out.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:85.05pt;text-indent:-85.05pt\"><b><span style=\"font-size:16.0pt;line-height:\r\n115%;font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\">    The Study purpose<o:p></o:p></span></b>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    To determine therapeutic effects of\r\nmagnetotherapy with \"traveling\" magnetic field of the device\r\nALMAG-02\" for complex treatment of patients suffering from varicose\r\ndisease of lower extremities veins.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:16.0pt;line-height:115%;font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">    Material and\r\nmethods of the Study<o:p></o:p></span></b>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    This study has analyzed results of\r\nexamination and conservative treatment of 137 patients suffering from varicose\r\ndisease of  lower extremities veins of\r\nCII-?IV stages (according to CEAP classification).<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    Depending on comprehensive treatment\r\nstructure the patients were divided into three groups.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    The 1st group of patients  (37 persons) were conducted with complex\r\ntreatment, which included taking Diosmin for a month and using  compression stockings of the 2-nd compression\r\nclass (made by the firm MEDI, Germany).<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    The 2-nd group of patients (50 persons)\r\ntook Diosmin, were made interstitial electrophoresis of Ginkor-Forte medicine\r\nof veintone action. In 1.5 hour after taking medicines transverse galvanization\r\nof lower legs with the device \"Potok-1\" was performed. Compression\r\nstockings of the 2-nd compression class (made by the firm MEDI, Germany) were\r\nused.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    In the 3rd group of patients (50 persons)\r\nwere conducted with complex treatment, which included taking Diosmin,\r\nmagnetotherapy with \"traveling\" magnetic field of the device\r\nALMAG-02\" according to the program No. 18. Compression stockings of the\r\n2-nd compression class (made by the firm MEDI, Germany) were used for 2 months.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">    All patients got a standard medical\r\nexamination, using instrumental and laboratory methods of research:<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo1\">\r\n    <!--[if !supportLists]--><span style=\"font-size:16.0pt;line-height:115%;mso-bidi-font-family:Calibri;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">        \r\n</span></span>\r\n    <!--[endif]--><span style=\"font-size:16.0pt;line-height:115%;\r\nfont-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"> dynamics assessment of pain syndrome was\r\ncarried out according to the visual analogue pain scale (VAS). <o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo1\">\r\n    <!--[if !supportLists]--><span style=\"font-size:16.0pt;line-height:115%;mso-bidi-font-family:Calibri;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">        \r\n</span></span>\r\n    <!--[endif]--><span style=\"font-size:16.0pt;line-height:115%;\r\nfont-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">veins ultrasonic\r\nduplex angioscanning of lower extremities with color mapping of blood flow on\r\nthe unit Toshiba SSC-380.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size:16.0pt;line-height:\r\n115%;font-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"><o:p> </o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><b><span style=\"font-size:16.0pt;line-height:100%;font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">The study results<o:p></o:p></span></b>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size:16.0pt;line-height:\r\n100%;font-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"> Reduction of skin pigmentation degree.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpLast\"><span lang=\"RU\"></span><span style=\"font-size:16.0pt;\r\nline-height:100%;font-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"><o:p></o:p></span>\r\n</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td></td>\r\n            <td>\r\n                <p><span lang=\"RU\">before treatment<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p><span lang=\"RU\">after treatment<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 1 st group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">3,3<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">2,5<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 2 nd group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\