g=\"RU\">3,1<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"mso-yfti-irow:3;mso-yfti-lastrow:yes;height:14.85pt\">\r\n            <td>\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 3 rd group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">6,1<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">2,3<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">Significant reduction of malleolares\r\nand maximum circumference of affected leg indicating a decrease of leg’s edema<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span lang=\"RU\">\r\n</span><span style=\"font-size:16.0pt;\r\nline-height:115%;font-family:\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"><o:p></o:p></span>\r\n</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" style=\"width: 241.55pt; margin-left: 4.65pt;\">\r\n    <tbody>\r\n        <tr>\r\n            <td></td>\r\n            <td>\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 1 st group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 2 nd group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 3 rd group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"mso-yfti-irow:1;height:30.0pt\">\r\n            <td width=\"75\" valign=\"bottom\" style=\"width:56.5pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:30.0pt\">\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">before treatment<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">55,4<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">54,8<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">55,6<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"mso-yfti-irow:2;height:30.0pt\">\r\n            <td>\r\n                <p><span lang=\"RU\">after treatment<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">49,6<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td>\r\n     