;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">5,2<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td width=\"104\" valign=\"bottom\" style=\"width:77.95pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">5,6<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"mso-yfti-irow:3;mso-yfti-lastrow:yes;height:15.0pt\">\r\n            <td width=\"77\" valign=\"bottom\" style=\"width:57.45pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"RU\">the 3 rd group<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td width=\"95\" valign=\"bottom\" style=\"width:70.9pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">5,2<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n            <td width=\"104\" valign=\"bottom\" style=\"width:77.95pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n                <p class=\"MsoNormal\" align=\"right\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\n  text-align:right;line-height:normal\"><span lang=\"RU\">5,7<o:p></o:p></span>\r\n                </p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:.75in;mso-add-space:auto\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\"><o:p> </o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span lang=\"RU\" style=\"font-size:16.0pt;line-height:115%;\r\nfont-family:\" Arial \",\"sans-serif \"\">    </span><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\">Thus, the application of magnetotherapy in complex\r\ntreatment of patients of varicose disease significantly improved tissue\r\nperfusion of  lower extremities that  may be a result of improved collateral blood\r\nsupply.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:16.0pt;line-height:115%;font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">Conclusions<o:p></o:p></span></b>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo2\">\r\n    <!--[if !supportLists]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-fareast-font-family:Arial;mso-ansi-language:EN-US\">1.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">  </span></span>\r\n    <!--[endif]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\">Under the action of low-frequency magnetotherapy\r\npatients of varicose vein disease of lower extremities feel reduced foot pain\r\nand get reduced degree of lower legs skin pigmentation.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo2\">\r\n    <!--[if !supportLists]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-fareast-font-family:Arial;mso-ansi-language:EN-US\">2.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">  </span></span>\r\n    <!--[endif]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\">Magnetotherapy in the complex treatment of patients\r\nwith varicose disease has a strong lymphatic effect that is verifiable by a\r\nprogressive decrease of malleolares and maximum circumferences length of lower\r\nleg and affected limb.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo2\">\r\n    <!--[if !supportLists]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-fareast-font-family:Arial;mso-ansi-language:EN-US\">3.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">  </span></span>\r\n    <!--[endif]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\">Complex treatment of patients with varicose veins\r\ndisease of the lower extremities including magnetotherapy increases the linear\r\nand volumetric velocity of venous blood flow in the affected veins, increases\r\nthe linear velocity of tissue blood flow in the affected limb.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo2\">\r\n    <!--[if !supportLists]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-fareast-font-family:Arial;mso-ansi-language:EN-US\">4.<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">  </span></span>\r\n    <!--[endif]--><span style=\"font-size:16.0pt;line-height:115%;font-family:\" Arial \",\"sans-serif \";\r\nmso-ansi-language:EN-US\">If patients with varicose veins disease of the lower\r\nextremities are treated with \r\nlow-frequency magnetotherapy it causes improvement in the quality of\r\nlife by criteria of physical, psychological and role functioning (determined by\r\nusing the total SF-36 questionnaire), and pain and social scales (determined by\r\nmeans of a special questionnaire CIVIQ), they are  most pronounced when using this method.<o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"><o:p> </o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\"><o:p> </o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">Head of  Physiotherapy Department, <o:p></o:p></span>\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">Doctor of the highest\r\nqualification category <o:p></o:p></span>\r\n</p>\r\n<p>\r\n\r\n\r\n\r\n\r\n\r\n</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:16.0pt;line-height:115%;font-family:\r\n\" Arial \",\"sans-serif \";mso-ansi-language:EN-US\">Golovach Tatiana<o:p></o:p></span>\r\n</p>\r\n<p>\r\n    <br>\r\n</p>', 8, 1);
