(70, 'depression treatment ', '290817065851helmet.jpg', '<div class=\"col-md-12\"><p><span style=\"font-size: 24px;\"><b><iframe width=\"100%\" height=\"auto\" src=\"https://www.youtube.com/embed/EZLtrMQoQ_0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></b></span><br></p><p><b><span style=\"font-size:18pt\"><br></span></b></p><p><b><span style=\"font-size:18pt\">No Medicine and Zero side effects and 100 % Safe to use</span></b></p><p><span style=\"color: rgb(255, 255, 255); font-family: Raleway; font-size: 17px; letter-spacing: 1px; text-align: center; background-color: rgb(182, 195, 135);\">Utilizes Pulsed Magnetic energy at specific frequencies to amplify the brain’s ability to resolve issues associated with trauma.</span><b><span style=\"font-size:18pt\"><br></span></b></p><div class=\"col-md-12\" style=\"margin: 0px; padding-top: 0px; padding-bottom: 0px; width: 100%;\"><br><p >\r\n\r\n<span style=\"box-sizing: border-box\"></span></p><p style=\"\"><p><b>As with\r\nall devices,&nbsp;<span style=\"box-sizing: border-box;\">training and free\r\nshipping will be provided</span><font color=\"#333333\"><span style=\"background-color: white;\"><o:p></o:p></span></font></b></p></p><p><span style=\"font-size: 14pt; font-family: Arial, sans-serif;\"><span style=\"font-size: 10pt;\"><b><o:p></o:p></b></span></span></p><p><b>All our\r\nproducts come with a 1 year full warranty on any manufacture defects&nbsp;</b></p><p><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\"><br></span></p><p><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\"><o:p></o:p></span></p><p>&nbsp;&nbsp;More specifically, it\r\nis a non-invasive, low-intensity pulsed magnetic (pEMF) simulator, for the\r\npurpose of enhancing therapeutic effect. The stimulation is than Transcranial\r\nMagnetic Stimulation (TMS) devices.&nbsp;</font>The&nbsp;stimulation is undetectable to the human\r\nbody, allowing the client to relax during treatment and enjoy the immediate benefits<font face=\"Arial, sans-serif\"><span style=\"font-size: 10pt; letter-spacing: 0.75pt;\">.\r\n</span></font>As\r\nthe output of our simulator is so gentle, it is possible to give pulsed EMF\r\nstimulation at a more efficient therapeutic frequency without the discomfort\r\nassociated with other Transcranial Magnetic Stimulation Known as rTMS. low field transcranial\r\nmagnetic stimulation helmet&nbsp;is PEMF therapy device that used pulse\r\nElectro- Magnetic fields to aid the in-body restoration. Since it\'s ergonomic\r\ndesign, users of all ages may receive effects of PEMF. we treat almost all neurological and psychiatric ailments including depression with Transcranial Magnetic Stimulation Helmet.&nbsp;Featuring 6 travelling\r\nemitter, the device evenly spread low powered PEMFs around the cranium,\r\nrecharging sensitive neural tissue&nbsp; &nbsp; &nbsp;</p><p><span style=\"font-size: 10.5pt; font-family: Helvetica, sans-serif;\">Individuals\r\nwith major depressive disorder or bipolar disorder who receive low-field\r\nmagnetic stimulation (LFTMS) show immediate and substantial mood improvement,\r\nwe had clinical trials on 40 depression patients in Delhi with low field transcranial\r\nmagnetic stimulation helmet and all of them had responded well within 30 days\r\non daily use for one hour except 2 had palpitation increases during the\r\ntreatment so they left in between&nbsp;<br>\r\n10 Hz frequency was given with 100-150 micro Tesla&nbsp;<span class=\"textexposedshow\">with this helmet\r\nwith six coils around the head that covers whole brain so you have not to\r\nsearch where to keep the coil like traditional rTMS devices and even the current is\r\nso week that you will not feel any thing during the treatment like no jerks and\r\ntwitching&nbsp;<br>\r\n<span class=\"textexposedshow\">Using a portable LFTMS device that designed by PEMF\r\nTRANS who made this device according to NASA research, Copenhagen Neurofield\r\nand Harvard University<o:p></o:p></span></span></span></p><p><span class=\"textexposedshow\"><span style=\"font-size: 10.5pt; font-family: Helvetica, sans-serif;\">&nbsp;We had studied 40\r\nvolunteers between the ages of 18 and 65. All participants had been diagnosed\r\nwith either major depressive disorder or bipolar disorder and had been on a\r\nregimen of antidepressants or mood-stabilizing medications for at least six\r\nweeks</span></span><span style=\"font-size: 10.5pt; font-family: Helvetica, sans-serif;\"><br>\r\n<span class=\"textexposedshow\">LFMS treatment indicated a marked improvement in\r\ntheir mood, while those whose brains were not stimulated reported no change in\r\nmood.</span><br>\r\n<span class=\"textexposedshow\">It was also found that their depression was\r\nimproved by 50-60% in 15-20 sessions only .</span></span><o:p></o:p></p><p><span style=\"font-size: 10.5pt; font-family: Helvetica, sans-serif;\">Although\r\nlarger research studies are needed, we think LFTMS could be a powerful tool as\r\na rapidly acting treatment for depression, either alone or in combination with\r\nmedication.&nbsp;<br>\r\nWe are very pleased with the outcome of this trial and what it could mean for\r\nthose with MDD, particularly those who have failed to achieve adequate\r\nimprovement from prior antidepressant treatment,<br>\r\nThis study is an important milestone for the company on the path to bring LFTMS\r\nto the market.</span></p><p><span style=\"font-size: 10.5pt; font-family: Helvetica, sans-serif;\"><br></span></p><p><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">To remove the confusion about rTMS i am posting here&nbsp;</span></font></p><p><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">There are two type of rTMS devices one is very high intensity rTMS device that can only be used by the professional doctors in their clinic or hospitals who has special training to run these devices and they are&nbsp; &nbsp;physiatrist doctors and another one is low field trancranial magnetic stimulation devices that can be used in home without any prescription as well as in clinics /hospitals by a doctor.We are using this device which is also registered by the FDA in USA.</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">&nbsp;Many research has been done on low field transcranial&nbsp; magnetic stimulation devices which can be read on Google.&nbsp;</span></font></p><p><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">&nbsp;Both the devices have same&nbsp; therapeutic effects.</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Hope this would have cleared your confusion about rTMS and we are&nbsp; not&nbsp; a Phycriatrist Doctor and&nbsp; using&nbsp; low intensity&nbsp; &nbsp;rTMS&nbsp; for depression and other ailments with good results.</span></font></p><p><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">we have treated more than 40 cases of depression where anti depressant medicine failed to give any relief</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Also treated&nbsp;</span></font><span style=\"font-size: 14px; color: rgb(51, 51, 51); font-family: Helvetica, sans-serif;\">Can be used in Following Diseases</span></p><p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Parkinson</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Stroke</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Cerebral Degeneration</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 14px;\">Ataxia</span></font></p><p style=\"margin: 0in 0in 0.0001pt; background-im