(75, 'We makes no medical claims as to benefit of our device and methods', '130917044523image.jpeg', '<p class=\"p1\" style=\"margin-bottom: 20px; text-size-adjust: 100%;\"><font color=\"#444c50\" face=\"Ubuntu, sans-serif\"><span style=\"font-size: 16px;\">Disclaimer: Product(s) featured on this website are not medical devices. They are not intended for the diagnosis, treatment or cure of any physical or medical condition. If you are experiencing symptoms of a physical or medical condition, you should seek the advice of your medical professional immediately.&nbsp;</span></font></p><p class=\"p1\" style=\"margin-bottom: 20px; text-size-adjust: 100%;\"><font color=\"#444c50\" face=\"Ubuntu, sans-serif\"><span style=\"font-size: 16px;\">&nbsp;</span></font></p><p class=\"p1\" style=\"margin-bottom: 20px; text-size-adjust: 100%;\"><font color=\"#444c50\" face=\"Ubuntu, sans-serif\"><span style=\"font-size: 16px;\">Personal testimonials supplied within quotations, or in direct statements on video, are strictly the opinions of each author, based upon personal experience. These statements are not intended as implied medical advice.&nbsp;</span></font></p><p class=\"p1\" style=\"margin-bottom: 20px; text-size-adjust: 100%;\"><font color=\"#444c50\" face=\"Ubuntu, sans-serif\"><span style=\"font-size: 16px;\">Please note that these pages are for general information purposes, to give you an idea of the scope of PEMF, how PEMF works, what PEMF research studies show about its general effects, and the wide range of health issues that have been helped by PEMF. These PEMF studies, and explanations of how PEMF works, should not be interpreted as proof that anyone other than the study participants would receive the same reported benefits. Rather it is provided as a source of inspiration to you in how PEMF might help you improve your own health.&nbsp;</span></font></p><p class=\"p1\" style=\"margin-bottom: 20px; text-size-adjust: 100%;\"><font color=\"#444c50\" face=\"Ubuntu, sans-serif\"><span style=\"font-size: 16px;\">Just as no two people are affected the exact same way , there is no “one size fits all” treatment that cures all. What works for one person might not work for another.It is not necessary that you will receive similar or identical results.&nbsp;</span></font></p><div><br></div><div><br></div>', 0, 1),
