(85, 'emtech PEMF device', '231118075308image.png', '<p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><img class=\"img-responsive\" src=\"data:image/jpeg;base64,\" data-filename=\"image.jpeg\" style=\"width: 566px;\"><img \r\nclass=\"img-responsive\" src=\"data:image/jpeg;base64,\" data-filename=\"image.jpeg\" style=\"width: 566px;\"><img class=\"img-responsive\" src=\"data:image/jpeg;base64,\" data-filename=\"image.jpeg\" style=\"width: 566px;\"></p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><br></p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><span style=\"color: rgb(77, 77, 79); font-family: RobotoRegular; font-size: 16px; -webkit-text-size-adjust: 100%;\">It does not treat any particular disease. Instead, Emtech Ultimate strengthens your body’s existing self-healing processes and other treatments, speeding up the healing process and promoting your immune system. By improving your blood circulation, cellular energy levels, and metabolic rate, Emtech Ultimate increases the effectiveness of the nutrients you consume, and aid’s your body’s detoxification process, providing you with a simple step toward healthier living</span><br></p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><br></p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Through the sophistication of advanced German technology, Emtech Ultimate is the first to integrate the following 4 naturally occuring energies that regulates and enhances our body’s natural self-healing mechanisms:</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">1) HIGHT ELECTRIC POTENTIAL<br>2) PULSATING ELECTROMAGNETIC&nbsp;<br>FREQUENCIES (PEMF)<br>3) FAR INFRARED<br>4) THERMOXIBUSTION</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Technical Specifications<br>Power Supply -230v 50hz<br>Power Consumption 70W<br>Duration 30 mins± 5 mins<br>Heat Temperature Adjustable within --460C<br>Output Voltage 20kV/15kV/1 OkV ± 20%<br>Fuse 250W1A 0 5 x 20mm<br>Dimension 38(L) x 351W) x 9(H) cm<br>Weight 4.65kg (Net)<br>Max. Surface Loading120kg (Max.)<br>Intrument Type Type II B Common Instrument Condition in Use<br>Temp. : 5oc-40oc, Humidity: &lt;80%<br>Condition for Storage<br>Temp. : Ooc-40oc, Humidity: &lt;80%</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">HIGHT ELECTRIC POTENTIAL</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">The cell membrane voltage of a healthy cell in a state of rest is 70 to 90mV. When it is sick, the voltage sinks down to 30 to 50mV. When such charge is low, it hinders cells intake of nutrients and oxygen as well as cellular detoxification which cause body cells unable to function properly and cause problems to our body.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">By introducing ultra-low currents to flow energy through the body and cells. The cells is then utilizes this energy to repair damages and replenish cellular charges.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">THERMOXIBUSTION</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Moxibustion is a traditional Chinese medicine therapy which consists of burning dried mugwort (moxa) on particular points on the body. It plays an important role in the traditional medical systems of China (including Tibet), Japan, Korea, Vietnam and Mongolia.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Thermoxibustion stimulates circulation through the acupoints and inducing a smoother flow of blood and qi. The heat causes vasodilation (dilating blood vessels) increases the supply of oxygen and nutrients and the elimination of carbon dioxide and metabolic waste.<br>Far Infrared Rays are invisible waves of energy that have the ability to penetrate all layers of the human physical body, penetrating into the inner-most regions of the tissues, muscles and bone.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">FAR INFRARED</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Far Infrared therapy (FIR) involves the use of Far Infrared rays to gently heal, soothe, stimulate and detox the physical body, as well as the mind. When we slightly induce a very small temperature increase, we can enhance our body’s functioning on multiple levels.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Clinical study</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Objectives<br>• To compare the efficacy of Gemtech Therapy vs Sham control on blood pressure and glycemic control.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">• To determine the safety and tolerability of Gemtech.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Methology<br>• Randomised controlled single blind comparative crossover trial.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">• The same patients undergo treatmenteveryday using the active machine for a month, followed by the sham machine for another month.</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">• Glycemic and Blood pressure levels are then compared..</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Results<br>• Trend of decrease in the systolic blood pressure in 65% of the patients</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">• Trend of decrease in Fast Blood Sugar, and HbA1C measurements in 55% of the patients</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">• No adverse effects were reported</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Conclusion<br>• Results as a preliminary study are encouraging, and the scientists propose further studies to be done with more controlled settings and a longer time period for more significant results to be observed.</p><p><br></p><p><br></p><p style=\"margin-top: 6px; margin-bottom: 0px; display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">• Emtech treatment has shown to aid some in lowering their blood sugar levels and blood pressure, with varying effectiveness between patients.</p><p style=\"margin-top: 6px; margin-bottom: 0px; display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><br></p><p style=\"margin-top: 6px; margin-bottom: 0px; display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><br></p>', 0, 1);
