(6, 'Backpain Treatment in Delhi- Best Treatment- India', '<p style=\"\"><font color=\"#626161\" face=\"Gudea, sans-serif, Helvetica\"><b>Backpain Treatment</b></font><br></p><p style=\"\"><span style=\"color: rgb(35, 31, 32); font-family: ProximaNova, Arnhem, Arial, Helvetica, sans-serif; font-size: 18px;\">Back pain is a common reason for absence from work and doctor visits. Although back pain may be painful and uncomfortable, it is not usually serious.</span><br></p><p style=\"font-size: 18px; line-height: 26px; margin-bottom: 25px; color: rgb(35, 31, 32); font-family: ProximaNova, Arnhem, Arial, Helvetica, sans-serif;\">Even though back pain can affect people of any age, it is significantly more common among adults aged between 35 and 55 years. Experts say that back pain is associated with the way our bones, muscles, and ligaments in our backs work and connect together.Pain in the lower back may be linked to the bony lumbar spine, discs between the vertebrae, ligaments around the spine and discs, spinal cord and nerves, lower back muscles, abdomen and pelvic internal organs, and the skin around the lumbar area. Pain in the upper back may be due to disorders of the aorta, tumors in the chest, and spine&nbsp;<a href=\"http://www.medicalnewstoday.com/articles/248423.php\" title=\"Inflammation: Causes, Symptoms and Treatment\" class=\"keywords\" style=\"background-color: rgb(255, 255, 255); color: rgb(5, 162, 211); border-bottom: none; outline: 0px;\">inflammation</a>.</p><p style=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"about-us-image-bg-02.jpg\" class=\"img-responsive\"><br></p>', 'Backpain Treatment in Delhi- Best Treatment- India', 'backpain treatment,  best doctor for backpain treatment, backpain treatment in delhi, backpain treatment hospital, PEMFTRANS backpain treatment', 'PEMFTRANS is a leading clinic in Delhi for providing the best back pain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', '');
INSERT INTO `pages` (`id`, `name`, `des`, `metatitle`, `metakeyword`, `metades`, `fld_order`, `headup`, `headdown`) VALUES
(7, 'Kneepain Treatment in Delhi- Best Treatment- India', '<p><b>Knee pain Treatment</b></p><p><br><p>Mild to moderate knee pain can often be successfully treated at home. Whether due to a sprain or arthritis, there are several ways to combat the pain.</p><p>Before you attempt to treat your pain at home, you should be cautious. Seek medical attention for moderate to severe pain caused by injury. Some types of knee pain can require surgery or other interventions to resolve. Surgery may be recommended in extreme cases of arthritis. See a doctor if you experience new knee pain after surgery.</p><p>However, if the pain is due to inflammation, arthritis, or a minor injury, there are options you can try at home that has proven effective. Read on for more information about alternative therapies and supplements that may help ease your knee pain.</p></p>', 'Kneepain Treatment in Delhi- Best Treatment- India', 'kneepain treatment, kneepain treatment for best doctor, kneepain treatment in Green Park Extension, kneepain treatment in delhi, kneepain treatment hospital, PEMFTRANS kneepain treatment', 'PEMFTRANS  is a leading clinic in Delhi for providing the best kneepain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(8, 'Best Treatment for depression in Delhi- Best Treatment- India', '<p><b>Best treatment for depression</b></p><div><br></div><p>When you’re depressed, it can feel like you’ll never get out from under a dark shadow. However, even the most severe depression is treatable. So, if your depression is keeping you from living the life you want to, don’t hesitate to seek help. Learning about your depression treatment options will help you decide what approach is right for you. From therapy to medication to healthy lifestyle changes, there are many effective treatments that can help you overcome depression and reclaim your life.</p><div><br></div>', 'Best Treatment for depression in Delhi- Best Treatment- India', 'best treatment for depression, best treatment for depression in Green Park Extension, best treatment for depression in delhi, best treatment for depression hospital, PEMFTRANS best treatment for depression ', 'PEMFTRANS  is a leading clinic in Delhi for providing the best treatment for depression in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(9, 'Knee Arthritis treatment in Delhi- Best Treatment- India', '<p><b>Knee Arthritis Treatment</b></p><div><br></div><p>There are three different types of arthritis that can occur in your knees. The most common type is osteoarthritis (OA), a progressive condition that slowly wears away joint cartilage. OA is most likely to occur after middle age.</p><p>Rheumatoid arthritis (RA) is an inflammatory condition that can strike at any age.</p><p>Post-traumatic arthritis develops following an injury to the knee. It can occur years after a torn meniscus, ligament injury, or knee fracture.</p><p>It’s possible to have more than one type of arthritis at a time. See your doctor for a diagnosis and to discuss a successful treatment plan for the specific type or types of arthritis you have.</p>', 'Knee Arthritis treatment in Delhi- Best Treatment- India', 'knee arthritis treatment, best knee arthritis treatment , knee arthritis treatment in delhi, knee arthritis treatment hospital, PEMFTRANS knee arthritis treatment ', 'PEMFTRANS  is a leading clinic in Delhi for providing the knee arthritis treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
