; font-family: \" open=\"\" sans\",=\"\" helveticaneue,=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" color:=\"\" rgb(83,=\"\" 83,=\"\" 83);\"=\"\">Your physiotherapist is a highly skilled professional who utilises <a href=\"http://physioworks.com.au/treatments-1/supportive-taping-or-strapping\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(24, 51, 177); outline: 0px;\">strapping</a> and taping techniques to prevent injuries. </p><p style=\"margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: \" open=\"\" sans\",=\"\" helveticaneue,=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" color:=\"\" rgb(83,=\"\" 83,=\"\" 83);\"=\"\">Some physiotherapists are also skilled in the use of <a href=\"http://physioworks.com.au/treatments-1/kinesiology-taping\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(24, 51, 177); outline: 0px;\">kinesiology taping</a>.</p>', 'Physiotherapy Treatment in Delhi- Best Treatment- India', 'physiotherapy treatment, best physiotherapy treatment, physiotherapy treatment in delhi, physiotherapy treatment hospital, PEMFTRANS physiotherapy treatment', 'PEMFTRANS  is a leading clinic in Delhi for providing the physiotherapy treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(11, 'Best Doctor for  backpain in Delhi- Best Treatment- India', '<p style=\"margin-bottom: 12px;\"><font color=\"#111111\" face=\"Helvetica, Arial, sans-serif\"><span style=\"font-size: 16px;\"><b>Best doctor for Backpain </b></span></font></p><div><br></div><p style=\"margin-bottom: 12px; font-size: 16px; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif;\">Most acute back pain gets better with a few weeks of home treatment. Over-the-counter pain relievers and the use of heat or ice might be all you need. Bed rest isn\'t recommended.</p><p style=\"margin-bottom: 12px; font-size: 16px; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif;\">Continue your activities as much as you can tolerate. Try light activity, such as walking and activities of daily living. Stop activity that increases pain, but don\'t avoid activity out of fear of pain. If home treatments aren\'t working after several weeks, your doctor might suggest stronger medications or other therapies.</p>', 'Best Doctor for  backpain in Delhi- Best Treatment- India', 'best doctor for backpain, best doctor for backpain treatment, best doctor backpain in delhi, best doctor for backpain hospital, PEMFTRANS best doctor for backpain', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for backpain in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(12, 'Best Doctor for kneepain in Delhi- kneepain treatment- India', '<p><b>Best doctor for Kneepain</b></p><p>Knee pain can be caused by a sudden injury, an overuse injury, or by an underlying condition, such as arthritis. Treatment will vary depending on the cause. Symptoms of knee injury can include pain, swelling, and stiffness.<br><br></p>', 'Best Doctor for kneepain in Delhi- kneepain treatment- India', 'best doctor for kneepain, best doctor for kneepain treatment, best doctor kneepain in delhi, best doctor for kneepain hospital, PEMFTRANS best doctor for kneepain', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for kneepain in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(13, 'Best Doctor for knee arthritis in Delhi- knee arthritis treatment- India', '<p><font color=\"#7c7c7c\" face=\"Lato, Trebuchet MS, Helvetica, sans-serif\"><b>Best doctor for Knee arthritis</b></font></p><div><br></div><p><span style=\"color: rgb(124, 124, 124); font-family: Lato, \"Trebuchet MS\", Helvetica, sans-serif;\">Knee is the largest joint in your body. It is a complex joint made of bone, cartilage and ligaments. The cartilage in the knee acts as a cushion and gliding surface. When healthy, the cartilage keeps the bones in the joint from rubbing together. However, when the joint is affected by arthritis, the bones make contact and cause pain. Injuries, aging and degenerative conditions such as arthritis can cause the cartilage to break down</span><br></p>', 'Best Doctor for knee arthritis in Delhi- knee arthritis treatment- India', 'best doctor for knee arthritis, best doctor for knee arthritis treatment, best doctor knee arthritis in delhi, best doctor for knee arthritis hospital, PEMFTRANS best doctor for knee arthritis', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for knee arthritis in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(14, 'Best Doctor for pain treatment in Delhi- pain treatment- India', '<p style=\"\"><font color=\"#7c7c7c\" face=\"Lato, Trebuchet MS, Helvetica, sans-serif\"><b>Best doctor for pain treatment </b></font></p><div><br></div><p style=\"color: rgb(124, 124, 124); font-family: Lato, \"Trebuchet MS\", Helvetica, sans-serif;\">Health professionals use different terms for different types of pain. Short-term pain, such as a sprained ankle, is called ‘acute’ pain. Long-term pain, such as back pain, is called ‘persistent’ or ‘chronic’ pain. Pain that comes and goes, like a headache, is called ‘recurrent’ pain. It is not unusual to have more than one sort of pain or to have pain in several places.</p><p style=\"margin-bottom: 0px; color: rgb(124, 124, 124); font-family: Lato, \"Trebuchet MS\", Helvetica, sans-serif;\">Many acute pains are a useful alarm signal that something is wrong. Most minor ones get better on their own or with simple treatment. Others may be a sign of something more serious, such as a broken leg. This pain is helpful because it means that you get treatment and rest your leg until the break has had a chance to heal. On the other hand, persistent pain appears to serve no useful purpose but has a huge effect on the lives of many people.</p>', 'Best Doctor for pain treatment in Delhi- pain treatment- India', 'best doctor for pain treatment, best doctor for pain treatment in delhi, best doctor pain treatment hospital, PEMFTRANS best doctor for pain treatment ', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for pain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(15, 'Backpain Treatment in Delhi- Best treatment- India', '<p><span style=\"color: rgb(124, 124, 124); font-family: Lato, \"Trebuchet MS\", Helvetica, sans-serif;\"></span></p><p><font color=\"#7c7c7c\" face=\"Lato, Trebuchet MS, Helvetica, sans-serif\"><b>Backpain Treatment in Delhi</b></font></p><div><br></div><p><span style=\"color: rgb(124, 124, 124); font-family: Lato, \"Trebuchet MS\", Helvetica, sans-serif;\">A mechanical problem is due to the way your spine moves or the way you feel when you move your spine in certain ways. Perhaps the most common mechanical cause of back pain is a condition called intervertebral disc degeneration, which simply means that the discs located between the vertebrae of the spine are breaking down with age. As they deteriorate, they lose their cushioning ability. This problem can lead to pain if the back is stressed. Another cause of back pain is the wearing down of the facet joints, which are the large joints that connect each vertebrae to another. Other mechanical causes of back pain include spasms, muscle tension, and ruptured discs, which are also called herniated discs.</span><br></p>', 'Backpain Treatment in Delhi- Best treatment- India', 'backpain treatment in delhi, best backpain treatment in delhi, best doctor backpain treatment, backpain treatment hospital, PEMFTRANS backpain treatment ', 'PEMFTRANS  is a leading clinic in Delhi for providing the best backpain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(16, 'Best kneepain treatment in Delhi- Best Treatment- India', '<p><span style=\"color: rgb(102, 102, 102); font-family: \"Open Sans\", sans-serif;\"></span></p><p><font color=\"#666666\" face=\"Open Sans, sans-serif\"><b>kneepain treatment in Delhi</b></font></p><div><br></div><p><span style=\"color: rgb(102, 102, 102); font-family: \"Open Sans\", sans-serif;\">Knee is a complex joint of the body comprising of cartilage, bone and ligaments. The knee cartilage functions to provide cushioning effect and a gliding surface. A healthy knee cartilage keeps the joint bones from rubbing against each other. However, in cases where knee joint is affected by arthritis, the joint cartilage wears off thereby allowing the joint bones to rub against each other and thus cause pain.</span><br></p>', 'Best kneepain treatment in Delhi- Best Treatment- India', 'kneepain treatment in delhi, best kneepain treatment in delhi, best doctor kneepain treatment, kneepain treatment hospital, PEMFTRANS kneepain treatment ', 'PEMFTRANS  is a leading clinic in Delhi for providing the best kneepain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(17, 'Best treatment for depression in delhi- Best Treatment- India', '<p><b></b></p><p><b>Best Treatment for depression in Delhi</b></p><div><br></div><p><b>HOW IS DEPRESSION TREATED?</b></p><div>Depressed mood may not require professional treatment, and may be a normal reaction to life events, a symptom of some medical condition, or a side effect of some drugs or medical treatments. A prolonged depressed mood, especially in combination with other symptoms, may lead to a diagnosis of a psychiatric or medical condition which may benefit from treatment. Different subdivisions of depression have different treatment approaches. In the United States, it has been estimated that two-thirds of people with depression do not actively seek treatment. The UK National Institute for Health and Care Excellence (NICE) 2009 guidelines indicate that antidepressants should not be routinely used for the initial treatment of mild depression because the risk-benefit ratio is poor. The treatment of depression is best managed by lifestyle choices, which includes, diet, sleep, and exercise. A recent meta-analysis also indicated that most antidepressants, besides fluoxetine, do not seem to offer a clear advantage for children and adolescents in the acute treatment of major depressive disorder<br></div>', 'Best treatment for depression in delhi- Best Treatment- India', 'best treatment for depression in delhi, best treatment for depression,  best doctor depression treatment , best treatment for depression hospital, PEMFTRANS best treatment for depression', 'PEMFTRANS  is a leading clinic in Delhi for providing the best treatment for depression in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(18, 'Knee Arthritis treatment in Delhi- Best Treatment- India', '<p align=\"JUSTIFY\" style=\"margin-bottom: 0in; color: rgb(51, 51, 51); font-family: Raleway, sans-serif; font-size: 15px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\"></span></p><p align=\"JUSTIFY\" style=\"margin-bottom: 0in;\"><font color=\"#333333\" face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\">Knee arthritis treatment in Delhi </span></font></p><div style=\"text-align: justify;\"><br></div><p align=\"JUSTIFY\" style=\"margin-bottom: 0in; color: rgb(51, 51, 51); font-family: Raleway, sans-serif; font-size: 15px;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">In knee osteoarthritis, the knee cartilage slowly wears away. In this type of arthritis, the protective cartilage over the bone at the knee joint wears away. Wearing of the cartilage results in the exposure of the bone. Swelling and severe pain are the results of this exposure of bone.</span></p><p align=\"JUSTIFY\" style=\"margin-bottom: 0in; color: rgb(51, 51, 51); font-family: Raleway, sans-serif; font-size: 15px; text-align: justify;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Treatment: Arthritis is a disease which does not have one simple and proven cure. There are so many ways of treatment which can be used on patients based on their stage of the disease. So you have to discuss your problem in detail with your physician and decide the most suitable treatment method for you.</span></p><p align=\"JUSTIFY\" style=\"margin-bottom: 0in; color: rgb(51, 51, 51); font-family: Raleway, sans-serif; font-size: 15px; text-align: justify;\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Weight loss: It has been found that reducing your weight will definitely help you to reduce the pain in the knee affected by arthritis</span></p>', 'knee arthritis treatment in delhi- Best Treatment- India', 'knee arthritis treatment in delhi, knee arthritis treatment in Green Park Extension, best knee arthritis treatment, best doctor knee arthritis treatment, best knee arthritis treatment hospital, PEMFTRANS knee arthritis treatment', 'PEMFTRANS  is a leading clinic in Delhi for providing the best knee arthritis treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(19, 'Physiotherapy Treatment in delhi- Best Treatment- India', '<p><span style=\"font-family: robotoregular; font-size: 15px;\"></span></p><p><font face=\"robotoregular\"><span style=\"font-size: 15px;\">Physiotherapy Treatment in Delhi </span></font></p><p><span style=\"font-family: robotoregular; font-size: 15px;\">Physiotherapy and Rehabilitation Department provides services to inpatients and ambulatory care patients at Apollo Hospitals, focusing on restoring the health, functional abilities and quality of life of people of all age groups affected by acute illness, injury or disability such as stroke, cerebral palsy, spinal cord injuries, heart surgery, amputation, joint replacement, sports injuries or spinal disorders, cancer surgery & congenital disorders</span><br></p>', 'Physiotherapy Treatment in Delhi- Best Treatment- India', 'physiotherapy treatment in delhi, physiotherapy treatment in Green Park Extension, physiotherapy treatment in Green Park Extension, best physiotherapy treatment, best doctor physiotherapy treatment, physiotherapy treatment hospital, PEMFTRANS physiotherapy treatment', 'PEMFTRANS  is a leading clinic in Delhi for providing the physiotherapy treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(20, 'Best Doctor for  backpain in Delhi- Best Treatment- India', '<p style=\"margin-bottom: 15px; line-height: 22px; padding-right: 0px;\"><font color=\"#333333\" face=\"robotoregular\"><b>Best Doctor for  Backpain in Delhi</b></font><br></p><p style=\"margin-bottom: 15px; font-family: robotoregular; line-height: 22px; padding-right: 0px; color: rgb(51, 51, 51);\">About 80 percent of adults experience low back pain at some point in their lifetimes. Affecting Men & Women equally, it is the most common cause of job-related disability and a leading contributor to missed work days.</p><p style=\"margin-bottom: 15px; font-family: robotoregular; line-height: 22px; padding-right: 0px; color: rgb(51, 51, 51);\">Acute back pain, or short term lasts for a few days to a few weeks. It tends to resolve on its own with self-care and there is no residual loss of function. The majority of acute low back pain is mechanical in nature, meaning that there is a disruption in the way the components of the back (the spine, muscle, intervertebral discs, and nerves) fit together and move.</p><p style=\"margin-bottom: 15px; font-family: robotoregular; line-height: 22px; padding-right: 0px; color: rgb(51, 51, 51);\">Subacute low back pain is defined as pain that lasts between 4 and 12 weeks.</p><p style=\"margin-bottom: 15px; font-family: robotoregular; line-height: 22px; padding-right: 0px; color: rgb(51, 51, 51);\">Chronic back pain persists for 12 weeks or longer, even after an initial injury or underlying cause of acute low back pain has been treated. About 20 percent of people affected by acute low back pain develop chronic low back pain with persistent symptoms at one year. In some cases, treatment successfully relieves chronic low back pain, but in other cases pain persists despite medical and surgical treatment.</p>', 'Best Doctor for backpain in delhi- Best treatment- India', 'best doctor for backpain in delhi, best doctor for backpain in Green Park Extension, best doctor for backpain treatment, backpain treatment,  best doctor for  backpain hospital, PEMFTRANS best doctor for backpain', 'PEMFTRANS  is a leading clinic in Delhi for providing the backpain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(21, 'Best Doctor for kneepain in delhi- Best treatment- India', '<p><span style=\"text-align: justify;\"><font color=\"#333333\" face=\"Raleway, sans-serif\"><span style=\"font-size: 15px;\">Best Doctor for kneepain in Delhi&nbsp;</span></font><br></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Raleway, sans-serif; font-size: 15px; text-align: justify;\">Knee Osteoarthritis is a situation in which the protective cartilage over the bone at the knee joint wears away. It cause bone exposure and thus results in swelling and severe pain. Intra Articular injections such as corticosteroids and hyaluronan is an alternative approach to the oral agents used for joint pain.</span><br></p>', 'Best Doctor for kneepain in delhi- Best treatment- India', 'best doctor for kneepain in delhi, best doctor for kneepain in Green Park Extension, kneepain treatment, best doctor kneepain hospital, PEMFTRANS kneepain, kneepain treatment', 'PEMFTRANS  is a leading clinic in delhi for providing the kneepain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(22, 'Best Doctor for knee arthritis in delhi- Best treatment- India', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\"></span></p><p><font color=\"#444444\" face=\"Open Sans, Helvetica, Arial, sans-serif\"><b>Best Doctor for knee arthritis in Delhi&nbsp;</b></font></p><div><br></div><p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">If you suffer from knee pain, it’s possible you have arthritis. Knee arthritis is caused by the deterioration of cartilage in the knee joint. The two most common types of knee arthritis are osteoarthritis and rheumatoid arthritis.</span><br></p>', 'Best Doctor for knee arthritis in delhi- Best treatment- India', 'best doctor for knee arthritis in delhi, best doctor for knee arthritis in Green Park Extension, best doctor for knee arthritis treatment, best doctor for kneepain hospital, PEMFTRANS best doctor for kneepain, knee arthritis treatment', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for knee arthritis in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(23, 'Best Doctor for pain treatment in delhi- Best treatment- India', '<p style=\"margin-top: 7px; margin-bottom: 7px; clear: both;\"><font color=\"#595959\" face=\"InterFaceDaMa-Regular\"><span style=\"font-size: 17px;\">Best Doctor for pain treatment in Delhi</span></font></p><div><br></div><p style=\"margin-top: 7px; margin-bottom: 7px; clear: both; color: rgb(89, 89, 89); font-family: InterFaceDaMa-Regular; font-size: 17px;\">Pain is the most common symptom that brings a patient to the hospital. Pain also interferes with the quality of life, ability to work, and perform simple activities like walking, exercising and sleeping comfortably. Generally people neglect their health by continuing to ignore their body’s signals and bear the pain till it becomes chronic and severe.</p><p style=\"margin-top: 7px; margin-bottom: 7px; clear: both; color: rgb(89, 89, 89); font-family: InterFaceDaMa-Regular; font-size: 17px;\">Pain management is a new branch of modern medicine that addresses all aspects of ‘pain’. This is an emerging specialty in India, but it has been around in Western countries for a few decades now. India has a burgeoning population of elderly patients and patients with chronic diseases like Diabetes, Arthritis and Backache. In addition, Cancer is on the rise in the population. Many patients continue to suffer pain in spite of medical or surgical treatment.</p>', 'Best Doctor for pain treatment in delhi- Best treatment- India', 'best doctor for pain treatment in delhi, best doctor for pain treatment in Green Park Extension, best pain treatment, pain treatment hospital, PEMFTRANS pain treatment, pain treatment', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for pain treatment in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
(24, 'Best physiotherapist in Delhi- Best treatment- India', '<p><b>Best Physiotherapist in Delhi</b><br></p><p><span style=\"color: rgb(50, 50, 50); font-family: open_sansregular, Calibri, Arial; font-size: 13px; text-align: justify;\">Physiotherapy is a health care profession that provides treatment to individuals to develop, maintain and restore maximum movement and function throughout life.&nbsp;</span><span style=\"color: rgb(51, 51, 51);\">PEMF Clinic</span><strong style=\"color: rgb(51, 51, 51); font-family: lato-r; font-size: 15px; text-align: justify;\">&nbsp;</strong><span style=\"color: rgb(50, 50, 50); font-family: open_sansregular, Calibri, Arial; font-size: 13px; text-align: justify;\">Centre for Physiotherapy and Physical Rehabilitation is located on 8th floor of the hospital and is spread over 5000 sq. ft. It employs the most advanced equipment procured from the world\'s leading manufacturers. A team of experienced physiotherapists at the Hospital judiciously chart the course of your recovery, helping you regain your independence, thus rebuilding your self-esteem and positive attitude.</span><strong style=\"color: rgb(51, 51, 51); font-family: lato-r; font-size: 15px; text-align: justify;\"><br></strong><br></p>', 'Best physiotherapist in Delhi- Best treatment- India', 'Best physiotherapist in Delhi, best physiotherapist treatment- Best physiotherapist treatment in Green Park Extension, Best physiotherapist treatment hospital', 'PEMFTRANS  is a leading clinic in Delhi for providing the best doctor for Best physiotherapist in Delhi, India. We treat without any medicines or drugs and only by PEMF techniques\r\n', 0, '', ''),
