(64, 'Nipun Kumar Sabbineni (Hyderabad)', '', '<p>I Would like to let you know, Hoow your PEMF treatment has helped me. I was diagnosed with Arthiritis, and Also have some other issues. I was very hesitant on purchasing this as I really did not think it would be of any benefit to myself. Anyway, I did make a purchase from you and have not have not regretted that decision. I have more energy now and feel I do need to take any medicine for Arthiritis.<br>Thank You,<br></p>', 2, 1),
(65, 'Rohit Dubey', '', '<p>I was suffering from back ache from 1 month, consultated with many doctors, but no result finally came to know about PEMF Bingo... My back ache is gone now <br></p><div><div><br></div></div><div><br></div>', 5, 1),
(66, 'Ravnish  Das', '', '<p>Life is not to live, but to be well. Health is the soul that animates all the enjoyments of life, which fade and are tasteless without it. </p><p><br></p><p>A sound mind in a sound body; if former be the glory of the latter, the latter is indispensable to the former. </p><p><br></p><p>The PEMF therapy centre at green park extension  is a temple for all health conscious citizens of the city. I know it for quite sometime. you go there, take care of your health; you no right to neglect it, and thus become a burden to yourself, and perhaps to others. </p><p><br></p><p>PEMF is not for spines only - its for your physical well being. I experienced it by going there regularly. The ambience, the friendliness of the trainers, the equipments - all worth enjoying. </p><p><br></p><p>I wish all the luck to those who run it. </p><div><br></div>', 4, 1),
(67, 'DOCTORS REVIEWS WORLDWIDE', '', '<p>Insulin Intake has been reduced , Hypertension is under control , Really Thanks to PEMF therapy centre . an efforts by Almag 02 Which Is a great Help to all. <br></p>', 3, 1),
(68, ' ', '', '<h1 style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 32px; font-variant-numeric: normal; font-variant-east-asian: normal; letter-spacing: -1px; line-height: 32px; margin-bottom: 0px; margin-top: 0px; padding: 0px 0px 15px;\"><cufon class=\"cufon cufon-canvas\" style=\"display: inline-block; font-size: 1px; height: 32px; line-height: 1px; margin: 0px; padding: 0px; position: relative; vertical-align: middle; width: 177px;\" alt=\"Testimonial\"><canvas width=\"202\" height=\"35\" style=\"height: 35px; left: -1px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px; position: relative; top: -4px; width: 202px;\"></canvas><cufontext style=\"display: inline-block; height: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; overflow: hidden; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px; text-indent: -960000px; width: 0px;\">Testimonial</cufontext></cufon></h1><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\"> </p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">PMF treatment in un-united fractures and failed Arthrodeses shows that in 1078 cases treated ,a success of 77 % was achieved ,a higher percentage of theses would have gone for amputation otherwise</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-a