rgin-bottom: 19.5px; padding: 0px;\">Pulsating field magneto-therapy will help resolve clinical ,sport and space medicine problems , improves cardiovascular ,nervous, allergic and other diseases, wounds heal faster and mental and physical strains disappear</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- Dr.Alexnader Obrosov</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Member USSR Academy of Medical Sciences</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">Pulsating magnetic fields can increase the rate of learning and memory retention.</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> – Dr.Ross Adey</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> President</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Veteran Administration Hospital,U.S.A</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">The infection in the bone could be cured in exactly half the time by electromagnetic technique. As compared to antibiotic technique “&”Electromagnetic technique has no side effects.</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- Dr.D.K.Belsare</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Prof.& Dean of Bio Sciences,</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Bhopal University</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">In diabetic foot ulcers “excellent results were obtained with two sittings per week in two weeks”& ”in all cases the patients had improvement in wound healing</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- Dr.V.U.Seethi (Orthopedic Surgeon)<br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n</strong><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">E.M.S Memorial Hospital<br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n</strong><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">Perintalmanna,Kerala</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">In my studies with PMF therapy I found favorable response and reduction in the grade if spasticity in Spastic diplegics,improvement in associated symptoms in migraine and reduction in frequency and intensity in Seizure Disorders</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- Dr. C.R.Ramaswamy</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">Consult Physician and Retd.Prof.of Therapeutics,</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">Govt.Stanley Medical College,Chennai.</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">We have treated nearly 50 CP-Spastic children on pulsatron since july-06. Nearly 50% reduction in muscle spasm in all cases and No epileptic fits in children ,after treatment ,Antiepileptic drugs for these children have been stopped.We are happy with PMF treatment on “Pulsatron” We are going to take up more cases and indications for treatment soon .</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\">-<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Dr.Ruta M.Kulkarni(M.S Ortho)</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> POST GRADUATE INSTITUTE OF SWASTHIYOG PRATISHTHAN</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">Pulsatron(pulsed magnetic field) machine is being used for 3 years in physiotherapy Dept for osteoporosis ,non and delayed union,Rheumatid Arthritis in theses conditions results are excellent. I found good result in even in Bed sores and chronic painful conditions.</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">-Dr.B Pradhan Physiotherapist ,</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Dr.Babasaheb Ambedkar Memorial Hospital (Central Railway.Byculla ,Mumbai)</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\"> <br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\nThis is for information of the concerned that I have been using PULSATRON(Pulsed Magnetic Field therapy)machines (two units)for the last 6 six years.More than 1000 cases from different faculties have been treated successfully .Scientific paper have been presented at local, state & national conferences.</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- Dr. A .K Singhal</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Healing Touches Hospital and Nursing Home</strong><br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n<strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\"> Sambalpur</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px;\">Pulsed Electromagnetic Field is effective in enhancing fracture healing .This is done by local synthesis of growth factors which enhance endochondral bone healing. It is Non-invasive and useful clinically for treatment of fractures and non unions.</p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- P.R.J.V.C Boopalan<br style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">\r\n</strong><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">Department of Orthopedics III,Christian Medical College, Vellore ,India</strong></p><p style=\"background-color: transparent; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-variant-numeric: normal; font-variant-east-asian: normal; margin-bottom: 19.5px; padding: 0px; text-align: right;\"><strong style=\"margin-bottom: 0px; margin-left: 0px; margin-right: 0px; margin-top: 0px; padding-bottom: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px;\">- Samuel