INSERT INTO `services` (`id`, `name`, `photo`, `des`, `fld_order`, `actstat`, `metatitle`, `metakey`, `metades`) VALUES
(1, 'Pain Treatment', '260817044520462459055.jpg', '<p>Pain Treatment using purely Magnetic PEMF Systems, All kinds of body pains can be cured by our therapy. Yes, you can get rid of your medicines and pills.</p><p>Paincarecentre provides one of the <b><a href=\"http://www.paincarecentre.com/service/Back+pain+Treatment.php\" target=\"_blank\">best doctor for pain treatment</a></b> where body pains can be cures by our expertise doctors.</p>', 0, 1, 'Best Doctor for Pain Treatment - Painspecialistclinic', 'best doctor for pain treatment in delhi', 'PEMFTRANS is a leading clinic in delhi for providing the Pain Treatment in delhi, India which provoides the best treatment for depression. We treat without any medicines or drugs and only by PEMF techniques.\r\n'),
(2, 'Knee Arthritis Treatment', '260817050551knee-arthritis.jpg', '<p>Also known as Osteoarthritis, This can be cured using our PEMF techniques. You can feel the relief from your arthritis pain very soon and can feel better without any Joint Replacement Operation. Paincarecentre provides the best <b><a href=\"http://www.paincarecentre.com/service/Knee+pain+Treatment.php\">knee arthiritis treatment</a></b>.&nbsp;<br></p>', 0, 1, 'Best Doctor for Knee Arthritis in Delhi | Painspecialistclinic', 'best doctor for knee arthritis in delhi', 'PEMFTRANS is a leading clinic in delhi for providing the knee arthritis Treatment in delhi, India which provoides the best treatment for depression. We treat without any medicines or drugs and only by PEMF techniques.\r\n'),
(3, 'Physiotherapy Treatment', '260817051839a556fbfbc9f0dc43ad0568e42db9e2fb_store_image.jpg', '<p><b>Physical therapy</b> (<b>PT</b>), mostly known as <b>Physiotherapy Treatment </b>in delhi,\r\n is a primary care specialty in western medicine that, by using \r\nmechanical force and movements [Bio-mechanics or Kinesiology], Manual \r\ntherapy, exercise therapy, electrotherapy and various physical therapies\r\n who practice evidence based treatments, remediates impairments and \r\npromotes mobility, function, and quality of life through examination, \r\ndiagnosis, prognosis, and physical intervention. It is performed by <b><a href=\"http://www.paincarecentre.com/product/Physiotherapy+at+our+therapy+centre.php\" target=\"_blank\">best physiotherapist in delhi</a>&nbsp;</b>(known as <b>physiotherapists</b> in many countries).&nbsp;<br></p><p class=\"MsoNormal\">We are specialist of <b>Physiotherapy treatment in Delhi</b>. This\r\nis a clinical health profession that aims to rehabilitate people following\r\ninjury and improve movement disorders. We use evidence based, natural methods,\r\nsuch as manual therapies, exercise and re-education of muscles. Paincare Centre\r\nteam of highly skilled and experienced clinicians understands individual\'s\r\nneeds and help you to manage your injury, reduce pain and return you to your\r\noptimal level of activity. Moreover, through our holistic approach we will\r\ntailor our treatments to your individual goals and specific requirements,\r\nworking with you to optimize your recovery and prevent recurrence.<br><br><b><a href=\"http://www.paincarecentre.com/services.php\" target=\"_blank\">Physiotherapists</a></b> manage movement dysfunction and enhance\r\nphysical and functional abilities. <b>Paincare Centre</b> help in restoring function,\r\nimprove mobility, relieve pain and prevent or limit permanent physical\r\ndisabilities of patients suffering from injuries or diseases. A physiotherapist\r\nexamines the patient to establish his/her sensed needs focusing on strength,\r\nflexibility, sitting and standing balance, coordination and build a treatment\r\nplan using exercise regime, techniques and modalities.</p><p class=\"MsoNormal\"><o:p></o:p></p>', 0, 1, 'Best Physiotherapy provided by Best Physiotherapist in Delhi', 'Best Physiotherapist in Delhi, Best Physiotherapist in South Delhi, Physiotherapy Treatment in Delhi, Best physiotherapy Treatment in Delhi, Physiotherapy Doctor in south Delhi, Best Physiotherapy Doctor in Delhi, Best physiotherapy Centre in Delhi, Best physiotherapy Clinic in Delhi', 'PEMFTRANS is a leading clinic in delhi for providing the physiotherapy treatment  in Delhi, India which provoides the best treatment for depression. We treat without any medicines or drugs and only by PEMF techniques.\r\n'),
(4, 'Back pain Treatment', '260817065231Mid-back-pain-1.jpg', '<p>Back pain is very common health issue in every generation and age-group. This can be cured with our PEMF Techniques, and Physio Therapy.<br></p><p class=\"MsoNormal\"><b><a href=\"http://www.paincarecentre.com\" target=\"_blank\">Low back pain</a></b> can be mild to very severe depending on its\r\nunderlying causes, how long it’s been left untreated and the state of someone’s\r\noverall health. The Medical Center states that several important risk factors\r\nfor lower back problems include family history of back pain, smoking or using\r\ntobacco, being overweight or obese, being female, being anxious or depressed,\r\nand either doing too much physical work or living a sedentary lifestyle.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">It’s estimated that up to 80 percent of adults experience\r\npersistent symptoms of back pain at some point in their lives, and about\r\n31 million Americans struggle with the condition at any given time. Given its extremely\r\nhigh prevalence rate whether due to a weak psoas muscle, sciatic nerve pain or\r\nsome other cause it’s not surprising that lower back pain is considered the\r\nsingle leading cause of disability worldwide according to the American Chiropractic\r\nAssociation, with half of all American workers reporting having occasional back\r\ntroubles each year.<o:p></o:p></p>', 0, 1, 'Backpain Treatment | Pain Specialist Clinic | India', 'best doctor for back pain in delhi', 'PEMFTRANS is a leading clinic in delhi for providing the Backpain Treatment in delhi, India which provoides the best treatment for depression. We treat without any medicines or drugs and only by PEMF techniques.'),
(5, 'Knee pain Treatment', '260817052744pain01.jpg', '<p><b>Knee pain</b> is a common complaint that affects people of all ages. Knee\r\n pain may be the result of an injury, such as a ruptured ligament or \r\ntorn cartilage. Medical conditions including arthritis, gout and \r\ninfections also can cause knee pain.</p><p class=\"MsoNormal\"><b><a href=\"http://www.paincarecentre.com/service/Knee+Arthritis+Treatment.php\" target=\"_blank\">Knee Pain Treatment</a></b> is the most common form of joint pain found in a\r\nvast majority of people globally. The elderly are the most affected by knee\r\npain. Learn all about it and avail consultation by our expert Physiotherapists\r\nat home.<o:p></o:p></p><p class=\"MsoNormal\">We specialize in management of Pain, movement and other\r\nNeuromusculoskeletal problems.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><b>Paincare Centre</b> started functioning from August 2015 after\r\nknowing the increase in disability due to pain among the people of Delhi and\r\nknowing the need for improving the quality of life and fitness of these people.\r\nAfter being more than 10 years in field of pain management, our specialists\r\nhave come out with a method of alleviating pain by integrating the best\r\npossible physical and neurophysiological methods available around the world. Our\r\nexperts are certified ergonomists and can deal well with ergonomics related\r\nproblems as well. We also do physiotherapy management of all sports injuries,\r\nother orthopedic and neurological problems including stroke rehabilitation, CP\r\nrehabilitation. We do take care of post-operative rehabilitation as well.<o:p></o:p></p><p>\r\n</p>', 0, 1, 'Best Doctor for Knee Pain Treatment in Delhi | Painspecialistclinic', 'knee pain treatment in delhi, best doctor for knee pain in delhi', 'PEMFTRANS is a leading clinic in delhi for providing the Knee Pain Treatment in delhi, India which also provoides the best treatment for depression. We treat without any medicines or drugs and only by PEMF techniques.\r\n'),
(6, 'Depression Treatment ', '260817075137depression.jpg', '<p></p><p>Psychotherapy is effective for most people with <b>depression treatment</b>. Your primary care doctor or psychiatrist can prescribe medications to relieve symptoms. However, many people with depression also benefit from seeing a psychiatrist, psychologist or other mental health professional.<br></p><p></p><p>If you have severe depression, you may need a hospital stay, or you may need to participate in an outpatient treatment program until your symptoms improve.<span style=\"font-family: monospace; font-size: medium; white-space: pre-wrap;\"> </span>We have special low field trans-cranial magnetic stimulation to help you recover from Depression and provides you the <b><a href=\"http://www.paincarecentre.com/services.php\" target=\"_blank\">best treatment for depression</a></b>.</p><p></p>', 0, 1, 'Best Treatment for Depression | Painspecialistclinic', 'best treatment for depression in delhi, best treatment for depression, best depression treatment in delhi', 'PEMFTRANS is a leading clinic in delhi for providing the best depression treatment in delhi, India which provoides the best treatment for depression. We treat without any medicines or drugs and only by PEMF techniques.\r\n'),
(7, 'knee pain', '290817110751hqdefault.jpg', '<p>no need of knee replacement surgery in 90% case after using PEMF</p><p>STUDY PAPER </p><p><br></p><p> <span style=\"font-family: Arial, sans-serif; font-size: 8pt; text-indent: -134.7pt;\">                                                                                           \r\n</span><span style=\"font-family: Arial, sans-serif; font-size: 8pt; text-indent: -134.7pt;\">Approved By</span></p>\r\n\r\n<p><span style=\"font-size:8.0pt;font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\">                                                                                           \r\nChief Physician of City Hospital of Healthcare Department<o:p></o:p></span></p>\r\n\r\n<p><span style=\"font-size:8.0pt;font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\">                                                                                            Of\r\n Leningrad Regional Clinical Hospital <o:p></o:p></span></p>\r\n\r\n<p><span style=\"font-size:8.0pt;font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\">                                                                                           \r\nV. M. Trishin /signature/   /official\r\nseal/<o:p></o:p></span></p>\r\n\r\n<p><span style=\"font-size:8.0pt;font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\"><o:p> </o:p></span></p>\r\n\r\n<p><b><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">Effectives Treatment Evaluation  of Gonarthrosis with \"Traveling\"\r\nMagnetic Field of the Device \"ALMAG-02\".<o:p></o:p></span></b></p>\r\n\r\n<p><b><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\"> </span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">Osteoarthritis (arthritis) is a disease of joints characterized by\r\ndegeneration and destruction of articular cartilage and causing proliferation\r\nof bone tissue, osteophytes formation, joints deformation and development of\r\nsecondary synovitis.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">People of second half life, more often women are especially prone to the\r\ndisease.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">It is believed that up to 20% of most countries population are susceptible\r\nto osteoarthritis. As the most often and  heavily the most loaded joints of the lower\r\nextremities (hip, knee and ankle joints) are affected, the life quality of this\r\npatients category is greatly reduced.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\"> </span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">Chronic disease period leads to serious difficulties of treatment as the\r\nmost commonly used in the treatment nonsteroidal anti-inflammatory drugs have\r\nnumerous and sometimes menacing side effects, especially considering the fact\r\nthat patient’s majority belongs to older age group and they are burdened with\r\npolymorbidity. Searching and application of treatment with physical methods, which\r\nhave no undesirable side effects in comparison to drugs, have enduring\r\nrelevance. One of such methods is \"traveling\" low-frequency magnetic\r\nfield generated by the magnetotherapy device of the third generation\r\n\"Almag-02\". It has the following effects determining the relevance of\r\nits application in this pathology:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">1.  reduces pain syndrome;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">2.  increases blood circulation in\r\njoints; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">3. has anti-edematous effect; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">4. normalizes the metabolism of chondrocytes and corrigiruet immune\r\ndisorders (there is an autoimmune component to the components of cartilage\r\ndamaging</span> <span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:EN-US\">in the\r\ndevelopment of osteoarthritis).<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">A significant advantage of this method in comparison to other physical\r\nmethods is the possibility of application with synovitis and it is well\r\ntolerated by patients.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\"> </span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">The purpose of clinical observation in the period from November, 2010 to\r\nDecember, 2011 was to evaluate the effectiveness of the low-frequency magnetic\r\nfield generated with the device \"ALMAG-02\" application for patients\r\nsuffering from  gonarthrosis (RC No. FRS\r\n2009/04790 of April 22, 2009.) A model for the study was a randomized group of\r\n36 patients suffering from knee osteoarthritis of moderate deterioration stage\r\nto I-II degree functional failure of joints. Patients were treated at hospital\r\nor at ambulatory conditions with treatment period of 14 days.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">The patients were divided into two groups: <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">first group – 19 patients took NSAIDs – Nimesulide  dosing of 200 mg/day for 14 days, Artrofoon\r\nsublingually to full dissolution dosing of 3-5 pills for 14 days, got massage\r\nand therapeutic gymnastics, <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">the second — magnetotherapy of the device \"ALMAG-02\", massage\r\nand medical gymnastics.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\"> </span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\";mso-ansi-language:\r\nEN-US\">Clinical examination of patients included assessment of:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">pain syndrome according to  100-millimeter scale Visual Analogue Scale and\r\nto pain scale of the Western Ontario and McMast?r University Osteoartritis\r\nIndex (WOMAC) subscore;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">knee joint motorfunction limitation, it was determined\r\nusing the fleximeter UGM-3 or KAWE and was assessed according to stiffness\r\nscale of WOMAC subscore;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">disease activity \r\naccording to the LIKERT scale;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">joint functional mobility by time measuring  of patient overcoming the distance of 15 m;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\"> limb</span> <span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">support ability by difference between the feet\r\npressure  on the weigher;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">tissue temperature  using a contact thermometer made by B. Well\r\ncompany (United Kingdom), model WF-2000;<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:\"Arial\",\"sans-serif\";mso-fareast-font-family:Arial;\r\nmso-ansi-language:EN-US\">-<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">      \r\n</span></span><!--[endif]--><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">rehabilitation potential and its dynamics according to\r\na brief set of codes of the ICF (International classification of functioning,\r\ndisability and health)for osteoarthritis.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\"> </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><span style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-US\">The data dynamic of the ICF categories: </span><span lang=\"RU\" style=\"font-family:\"Arial\",\"sans-serif\"\"><o:p></o:p></span></p>\r\n\r\n<table width=\"100%\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:28.5pt\">\r\n  <td width=\"63\" valign=\"top\" st